            item = HuashengPriceCompareItem()
            item['grabtime'] = time.strftime('%Y-%m-%d %X', time.localtime())
            item['url'] = response.url
            item['status'] = data['id'] + "-" + response.meta['model'] + "-" + response.meta['year'] + "-" + response.meta['family'] + "-" + data['carbrandname']
            item['brand'] = data['carbrandname']
            item['family'] = response.meta['family']
            item['year'] = response.meta['year']
            item['model'] = response.meta['model']
            item['id'] = data['id']
            item['name'] = data['packagename']
            item['price1'] = data['packageamt']
            item['price2'] = data['package4samt']
            item['type'] = data['packagetypename']
            yield item
